import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router";
import UserService from "../../user/service/UserService";
import ReCAPTCHA from "react-google-recaptcha"; // ✅ Import ReCAPTCHA

function Login() {
    const [userName, setUserName] = useState('');
    const [password, setPassword] = useState('');
    const [recaptchaValue, setRecaptchaValue] = useState(null); // ✅ reCAPTCHA value
    const [isLoading, setIsLoading] = useState(false); // Track loading state

    const navigate = useNavigate();
    const service = new UserService();

    useEffect(() => {
        // Redirect if already logged in
        if (sessionStorage.getItem('userId') !== null) {
            navigate("/");
        }
    }, [navigate]);

    const handleCaptcha = (value) => {
        setRecaptchaValue(value);
    };

    const handleLogin = (e) => {
        e.preventDefault();

        if (!recaptchaValue) {
            alert("Please verify that you are not a robot.");
            return;
        }

        setIsLoading(true); // Start loading

        service.loginService(userName, password)
            .then((result) => {
                if (result !== 0) {
                    alert("Login credentials are valid.");
                    service.getUserType(result.data).then((result1) => {
                        sessionStorage.setItem('userId', result.data);
                        sessionStorage.setItem('userType', result1.data);
                        sessionStorage.setItem('userName', userName);
                        window.location.reload();
                    }).catch(() => {
                        alert('Error fetching user type.');
                    });
                }
            })
            .catch(() => {
                alert('Invalid Username/Password. Please try again!');
                window.location.reload();
            })
            .finally(() => {
                setIsLoading(false); // Stop loading
            });
    };

    return (
        <div style={{ backgroundColor: "#f0f8ff", minHeight: "100vh", padding: "40px 0" }}>
            <div className="jumbotron text-center" style={{ backgroundColor: "#e6f2ff", borderRadius: "10px" }}>
                <h3><i className="fas fa-paper-plane mr-2"></i> Supporting You Through Your Travel Journey</h3>
                <h5>Let the journey begin</h5>
            </div>

            <div style={{
                maxWidth: "500px", margin: "0 auto", padding: "30px",
                borderRadius: "15px", boxShadow: "0 8px 16px rgba(0,0,0,0.1)", backgroundColor: "white"
            }}>
                <h2 className="text-center" style={{ marginBottom: "25px", color: "#007bff" }}>
                    <i className="fas fa-sign-in-alt"></i> Login
                </h2>

                <form>
                    <div className="form-group">
                        <label><i className="fas fa-user"></i> User Name</label>
                        <input
                            className="form-control"
                            type="text"
                            placeholder="Enter User Name"
                            value={userName}
                            onChange={(e) => setUserName(e.target.value)}
                            style={{ borderRadius: "10px" }}
                        />
                    </div>

                    <div className="form-group">
                        <label><i className="fas fa-key"></i> Password</label>
                        <input
                            className="form-control"
                            type="password"
                            placeholder="Enter Password"
                            value={password}
                            onChange={(e) => setPassword(e.target.value)}
                            style={{ borderRadius: "10px" }}
                        />
                    </div>

                    {/* ✅ Add Google reCAPTCHA */}
<div className="text-center my-3" style={{ display: "flex", justifyContent: "center", alignItems: "center" }}>
    <ReCAPTCHA
        sitekey="6LfTJDUrAAAAAFFhhI1OcQcuR4OCdODxv3di0Cap" // Replace with your actual site key
        onChange={handleCaptcha}
    />
</div>


                    <div className="text-center mt-4">
                        <button
                            className="btn btn-primary btn-block mb-2"
                            onClick={handleLogin}
                            disabled={isLoading} // Disable button while loading
                        >
                            {isLoading ? (
                                <span>Loading...</span> // Show loading text
                            ) : (
                                <>
                                    <i className="fas fa-sign-in-alt"></i> Login
                                </>
                            )}
                        </button>

                        <button
                            className="btn btn-success btn-block"
                            onClick={(e) => {
                                e.preventDefault();
                                navigate('/users/add');
                            }}
                        >
                            <i className="fas fa-user-plus"></i> New Registration
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default Login;
